const login = resolve => {
    import('./index').then(module => {
        resolve(module)
    })
}
const forgetPwd = resolve => {
    import('./forgetPwd').then(module => {
        resolve(module)
    })
}
const register = resolve => {
    import('./register').then(module => {
        resolve(module)
    })
}
const information = resolve => {
    import('./information').then(module => {
        resolve(module)
    })
}
export default [{
    path: '/login',
    component: login,
    // name: 'loginIndex',
    meta: {
        nav: false,
        auth: false,
        keepAlive: false,
        title: '登录'
    }
}, {
    path: '/forgetPwd',
    component: forgetPwd,
    meta: {
        nav: false,
        auth: false,
        keepAlive: false,
        title: '忘记密码'
    }
}, {
    path: '/register',
    component: register,
    meta: {
        nav: false,
        auth: false,
        keepAlive: false,
        title: '注册'
    }
}, {
    path: '/information',
    name: 'informationIndex',
    component: information,
    meta: {
        nav: false,
        auth: false,
        keepAlive: true,
        title: '完善信息'
    }
}]
